const express = require('express');
const app = express();

const path = '/pokemon';

/**
 * api GET 一覧 /pokemon
 * @returns ポケモンデータ一覧
 */
app.get(path, function (req, res, next) {
  //一覧取得はimage以外のデータを返す
  const data = mockData.map((data) => {
    return {
      no: data.no,
      name: data.name,
      type: data.type,
      feature: data.feature,
    };
  });
  res.json({ data });
});

/**
 * api GET 詳細 /pokemon/
 * @returns ポケモンデータ1件返却
 */
app.get(`${path}/:no`, function (req, res, next) {
  const { no } = req.params;
  const data = mockData.find((data) => data.no === no);
  res.json({ data });
});

app.listen(3000);

